import React from 'react';
import "../css/PostBox.css"

function PostBox() {
    return (
        <div className="postbox">
            <div className="postbox-info">
                <Profile />
                <h5>Username</h5>
            </div>
            <div className="postbox-feed">
                <p>Whatis your qestion?</p>
            </div>
        </div>
    )
    
}

export default PostBox;
